let cpf = {{CPF}}
cpf = cpf.toString()

let cpfValido;

if (cpf.length !== 11 || /^(\d)\1{10}$/.test(cpf)) {
  cpfValido = false;
} else {
  let soma = 0;
  for (let i = 0; i < 9; i++) {
    soma += parseInt(cpf.charAt(i)) * (10 - i);
  }
  let resto = (soma * 10) % 11;
  if (resto === 10 || resto === 11) {
    resto = 0;
  }
  if (resto !== parseInt(cpf.charAt(9))) {
    cpfValido = false;
  } else {
    soma = 0;
    for (let i = 0; i < 10; i++) {
      soma += parseInt(cpf.charAt(i)) * (11 - i);
    }
    resto = (soma * 10) % 11;
    if (resto === 10 || resto === 11) {
      resto = 0;
    }
    cpfValido = resto === parseInt(cpf.charAt(10));
  }
}

return cpfValido

// Data original no formato 'ano-mes-dia horas:minutos:segundos'
let dataOriginal = {{nascimento}};

// Separar a parte da data e criar um objeto Date
let partesData = dataOriginal.split(' ')[0];
let [ano, mes, dia] = partesData.split('-');

// Formatar a data para o formato 'dia/mes/ano'
let dataFormatada = `${dia}/${mes}/${ano}`;

return dataFormatada

